A set of images to display a single parameter (for example, images for displaying the day of the week or battery charge) should be the same size. If the size of the images is different, the first image in the set must be the largest in height and width. Otherwise, subsequent images will be cropped.
In order to quickly set the position of the element, you can quickly copy the desired coordinates by double-clicking on the preview and also paste the coordinates into the necessary fields.
All labels are displayed starting with left characters. Therefore, with a negative spacing, the right characters can overlap with those that go to the left.
You can change the order in which items are displayed by dragging the desired items in the list above or below with the mouse. For normal operation, shortcuts must be the topmost.
For shortcuts to work, it is necessary to add an image. You can just add a transparent image.
For the UV index, you need to use 5 images:
1 image – UV index value of 1... 2;
2 image – UV index value of 3... 5;
3 image – UV index value of 6... 7;
4 image – UV index value of 8... 10;
5 image – UV index value of 11+.
For the pulse, it is necessary to use 6 images that correspond to the pulse zones:
1 image – rest;
2 image – warm-up;
3 image – intense;
4 image – aerobic;
5 image – anaerobic;
