For the phases of the moon, it is recommended to use 30 images. Official documents also allow the use of 7 and 13 images, but this option may not display correctly in the editor.
Images that you don't need can be deleted by selecting them in the list and clicking Del or through the context menu. You can also directly delete them from the folder and use the context menu to refresh the list with images or reopen the project.
To quickly save changes to your project, you can use ctrl+S.
If the preview window has become very large and the zoom switches are invisible, you can change the zoom level using the cursor keys "Left", "Right" or the "Collapse" button.
Animations use a separate list of images. When you select one of the animation elements for editing, you will automatically switch to this list and you can add images to it.
The file names for frame animation must be in the format Prefix_X. Prefix is any word. X is the number of the animation frame, it must start from 0. Frame numbers are recorded without leading zeros. For example, the first frame might be named "test_anim_0".
